window.bookSummaryJSON = "<p><b>First in a New Military Science Fiction Series</b>&nbsp;</p> <p>\"I was on a dead ship on an unknown planet with three trainees freshly graduated into the Imperial Service. I tried to look on the bright side.\"&nbsp;</p> <p>He is the last to wake. The label on his sleeper pad identifies him as an admiral of the Evagardian Empire - a surprise as much to him as to the three recent recruits now under his command. He wears no uniform, and he is ignorant of military protocol, but the ship's records confirm he is their superior officer.&nbsp;</p> <p>Whether he is an Evagardian admiral or a spy will be of little consequence if the crew members all end up dead. They are marooned on a strange world, their ship's systems are failing one by one - and they are not alone.&nbsp;</p>"; 
